      <div className="container-fluid">
        <li className="nav-item active">
          <Link to="/" className="nav-link " aria-current="page">
            الكُتُب
          </Link>
        </li>
        <li className="nav-item">
          <Link to="/about" className="nav-link " aria-current="page">
            عن الموقع
          </Link>
        </li>
      </div>
    </nav>
  );
}
